  \"2016-04-01T18:55:25.609552\",\n\t\"name\": \"assessed-lakes-and-reservoirs\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the lakes and reservoirs
  that have been assessed and categorized by Department of Health-Division of Water
  Quality (NDDoH-WQ) for the 2014 Integrated Report submitted to and approved by the
  US EPA. A complete copy of the report is here: http://www.ndhealth.gov/WQ/SW/Z7_Publications/IntegratedReports/2014_North_Dakota_Integrated_Report_Final_20150428.pdf
  . (clicking on link opens the 276-page report in a new window). The lakes are a
  subset and enhancement of the 1:100,000 scale National Hydrography Dataset (NHD).
  NDDoH-WQ adds additional lakes or modifies outlines to reflect current conditions
  based on the most recent aerial imagery. Since the assessed and categorized lakes
  are a subset of the NHD lakes, only that subset is included in this dataset. Updated
  March 17, 2015\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
